import { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        { name: "frankenstein" },
        { name: "dracula" },
        { name: "zombie" },
      ],
    };
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <p> Hello, My name is Moncef </p>{" "}
          <img src={logo} className="App-logo" alt="logo" />
          <p>{this.state.string}</p>
          <p>
            <button
              onClick={() => this.setState({ string: "hello Moncef ;)" })}
            >
              {" "}
              Change text{" "}
            </button>
            <p> </p>
            Edit <code> src / App.js </code> and save to reload.{" "}
          </p>{" "}
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React{" "}
          </a>{" "}
        </header>{" "}
      </div>
    );
  }
}

export default App;
